import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "../src/pages/home.js"
import Services from "./Services"; // Ajusta según tu estructura

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
            </Routes>
        </Router>
    );
}

export default App;
